## 3. Type-Safe Configuration

The following example shows how to use type-safe configuration.

```typescript
interface DatabaseConfig {
  host: string;
  port: number;
  database: string;
}

const app = server<DatabaseConfig>();
app.config.set('database', {
  host: 'localhost',
  port: 5432,
  database: 'myapp'
});
